import './timer.css';
import { useState, useEffect } from 'react';

export default function Timer(props) {    
    const [time, setTime] = useState("00:00")

    function Time () {
        const initialTime = "00:01"; 
        setTime(prevTime => prevTime + initialTime) 
    }
      
    return (
        props.won ? "00:00" : {Time}
    )
}
